@sydroth I enjoy working with you because you have an eye for design and generally bring a positive attitude and a smile to your work. 

I would enjoy working with you more if the friction I see between you and some of the other players was remedied. I wish I could give you more actionable feedback but I don't know how to solve the problem. 

That said it is clear you are trying very hard to change. You've also been very kind in all of your challenging interaction. Keep trying, you'll get there.
